import './task.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

import axios from 'axios'

const Task = ({data, onClick}) => {

	const deleteTask = async({_id}) => {
		console.log(await axios.delete(`http://192.168.1.37:8080/db/tasks/${_id}`))
	}

	return (
		<div className='Task' onClick={onClick}>
			<span className='Title'>Title:</span>	{data.title}
			<button className='Delete' onClick={() => deleteTask(data)}>
				<FontAwesomeIcon icon="fa-sharp fa-solid fa-xmark" size='60' />
			</button>
		</div>
	)
}

export default Task
